#include <iostream>
#include <cstdlib>
#include <cstring>

using namespace std;

class Solution {
private:
    char* memo;
    int slen;
    int plen;
public:
    bool isMatch(const char *s, const char *p) {
        slen = strlen(s);
        plen = strlen(p);
        
        memo = new char [(slen+1) * (plen+1)];
        for (int i=(slen+1) * (plen+1) - 1; i>=0; i--) memo[i] = -1;
        bool ret = dfs(s, 0, p, 0);
        delete[] memo;
        return ret;
    }
    
    bool dfs(const char* s, int spos, const char* p, int ppos) {
        int idx = ppos * slen + spos;
        if (memo[idx] >= 0) return memo[idx];
        
        if (s[spos] == '\0' && p[ppos] == '\0') return true;
        if (p[ppos] == '\0') return false;
        if (s[spos] == '\0') {
            int i = ppos;
            for (; p[i] != '\0'; i++) {
                if (p[i] != '*') break;
            }
            memo[idx] = p[i] == '\0';
            return memo[idx];
        }
        
        
        bool ret = false;

        if (p[ppos] == '?') {
            ret = dfs(s, spos + 1, p, ppos + 1);
        } else if (p[ppos] == '*') {
            for (int i=0; s[spos + i] != '\0'; i++) {
                if (dfs(s, spos + i, p, ppos + 1)) {
                    ret = true;
                    break;
                }
            }
        } else if (p[ppos] == s[spos]) {
            ret = dfs(s, spos + 1, p, ppos + 1);
        }
        memo[idx] = ret;
        return ret;
    }
};

int main() {
    Solution s;
    
    cout<<s.isMatch("", "**")<<endl;

    system("pause");
	return 0;
}

